//src1, 10ms56ss
import React, { Component } from 'react';
import { Link } from "react-router-dom";
class Header extends Component {

    render() {
        // return (
            // 11ms20ss
            <div id='m_menu' className='ui menu'>
                {/* 11ms45ss, 24ms45ss */}
                <Link to='/' className='item'>
                    <i className='icon home'></i> Home
                </Link>

                <Link to='/song-add' className='item'>
                    <i className='icon music'></i> Song Add
                </Link>

                <Link to='/song-list' className='item'>
                    <i className='icon alternate'></i> Song List
                </Link>

                <Link to='/user-list' className='item'>
                    <i className='icon user'></i> User List
                </Link>
            </div>
        // )
    }
};

export default Header;
